import React from 'react';
import data from '../data/logement.json';
import Card from '../components/Card'; // Importer le composant Card
import '../sass/pages/home.scss'; // Assurez-vous que ce fichier existe et est stylé correctement

function Home() {
  return (
    <div className="home-container">
      {data.map(logement => (
        <Card key={logement.id} title={logement.title} cover={logement.cover} />
      ))}
    </div>
  );
}

export default Home;
